import React from 'react';
import { NavLink } from 'react-router-dom';
import { Navbar, Nav } from 'react-bootstrap';
import './Header.css';

function Header() {
  return (
    <Navbar expand="md" className="navbar-custom">
      <Navbar.Brand href="/" className="navbar-brand-custom">Умные Горшки для растений</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mx-auto">
          <Nav.Item>
            <NavLink to="/" activeClassName="active" className="nav-link-custom">Каталог</NavLink>
          </Nav.Item>
          <Nav.Item>
            <NavLink to="/about" activeClassName="active" className="nav-link-custom">О нас</NavLink>
          </Nav.Item>
          <Nav.Item>
            <NavLink to="/contact" activeClassName="active" className="nav-link-custom">Личный кабинет</NavLink>
          </Nav.Item>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default Header;
